import logo from './logo.svg';
import './App.css';
import Button from './Button';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a>
          Learn React
          Team Apple
        </a>
        <p>
          <Button />
        </p>
      </header>
    </div>
  );
}

export default App;
